let proxy;
const getProxy = async() => {
    try {
        const response = await fetch(process.env.REACT_APP_API_URL);
        const proxy_url = await response;
        proxy = proxy_url;
        console.log(proxy);
        return proxy
    } 
    catch(err) {
        console.log(err);
    }
};

